  name: nested-return
root:
  dag:
    outputs:
      parameters:
        Output:
          valueFromParameter:
            outputParameterKey: Output
            producerSubtask: nested-return
    tasks:
      nested-return:
        cachingOptions:
          enableCache: true
        componentRef:
          name: comp-nested-return
